import React from "react";
import Highcharts, { color } from 'highcharts';
import HighchartsReact from "highcharts-react-official";
import HighChartsMore from "highcharts/highcharts-more";
import item from "highcharts/modules/item-series"
import drilldown from "highcharts/modules/drilldown";
function WebDevChart() {
    drilldown(Highcharts);
     HighChartsMore(Highcharts);
    let options = {
        chart: {
            type:'packedbubble', 
            backgroundColor:'transparent',
            height:'300px'
        },
        // title: {
        // style:{color:'white',fontSize:'15px',fontFamily:'cursive'},
        // text: '(Click on each section for more info)'
        // },
        series: [{
             data: [{
                // name property is used for the datalabel
                // value property is used for the volume of the bubble
                value: 12,
                name: 'Bert'
            }, {
                value: 5,
                name: 'John'
            }, {
                value: 10,
                name: 'Sandra'
            }, {
                value: 7,
                name: 'Cecile'
            }]
        }, {
            name: 'Energy drinks', // Energy drinks series
            data: [{
                value: 10,
                name: 'Tristan'
            }]
        }, {
            name: 'Tea', // Tea series
            data: [5, 6, 8, {
                value: 10,
                name: 'Mustapha',
                color: 'pink'
            }]
        }],
        credits: {
            enabled:false
          }
    
    }


    return (
        <span>
      <HighchartsReact 
        highcharts={Highcharts}
        options={options}
      />
    </span>
    )
}



export default WebDevChart;
